  false,\n\t\"url\": null,\n\t\"notes\": \"Numbers of bald eagles (Haliaeetus leucocephalus)
  nesting along the lower Columbia River have doubled in the last six years, yet five-year
  running productivity averages are well below statewide values for eagles nesting
  in other areas of Oregon and Washington. While productivity of eagles along the
  Columbia River is low, nesting success in other areas of the two states is close
  to the goals established to delist the species from the Federal Endangered Species
  list. Previous contaminant studies conducted from 1985 to 1987 along the river found
  poor productivity associated with elevated DDE (dichlorodiphenyldichloroethane)
  and total polychlorinated biphenyls (PCBs) in eagle eggs. In addition, 2,3,7,8-tetrachlorodibenzo-p-dioxin
  (TCDD) and 2,3,7,8-tetrachlorodibenzofuran (TCDF) concentrations were found in five
  eggs collected in 1987 and 1991. From 1994-95, fresh bald eagle eggs were collected
  from nests in 19 of 43 occupied territories along the river. Eggshell thickness
  was determined on all eggs, and the contents were analyzed for organochlorine pesticides,
  total PCBs, polychlorinated dibenzo-p-dioxins (PCDDs), polychlorinated dibenzofurans
  (PCDFs), and planar PCBs (non-ortho and mono-ortho substituted congeners). Halogenated
  dioxin-like compounds in eggs were also evaluated based on a H4IIE rat hepatoma
  bioassay. Productivity and egg contaminant results from l 994 to 1995 were compared
  to a previous study to evaluate changes over time. Recent increases in productivity
  averages were due to new pairs nesting along the river, yet productivity at 23 older
  breeding areas remained low and was not different (P=0.713) between the two study
  periods. Eggshells averaged 11 percent thinner than shells measured prior to the
  use of the pesticide DDT (dichlorodiphenyltrichloroethane), and thickness of eggs
  from older breeding territories had not improved (P=0.404) between the two study
  periods. Decreases in p,p'-DDE (P=0.022) and total PCBs (P= 0.0004) in eggs from
  older breeding areas occurred between the two study periods, but concentrations
  were still above values associated with poor productivity. TCDD toxic equivalents
  (TEQs) exceeded estimated no-effect values for bald eagles during both studies.
  Bald eagle productivity over a five-year time period encompassing egg collection
  was not correlated to individual organochlorine compounds. Some dioxins, furans,
  planar PCBs, and TEQ values were correlated to nest location as river mile, with
  highest concentrations occurring at downriver breeding territories near the mouth.
  Although total productivity has increased due to the success of new nesting pairs
  moving into the region, results indicate that organochlorine contaminants continue
  to impact the breeding success of lower Columbia River eagles. The greatest impact
  of appears to occur at older breeding territories, which were located predominantly
  in the lower estuary below river mile 60. Eagles nesting toward the mouth of the
  river may be at greater risk of exposure to some dioxin-like compounds, and the
  reproductive success of some new pairs nesting in this area could be impacted in
  the future.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
